import React from "react";
import { Icon } from "../Icon/Icon";
import { Item } from "./DetailItem.styled";

export const DetailItem = ({ el }) => {
  let content;

  switch (el) {
    case "CD":
      content = (
        <>
          <Icon iconid={"icon-cd"} width={20} height={20} />
          <p>{el.CD} CD</p>
        </>
      );
      break;
    case "TV":
      content = (
        <>
          <Icon iconid={"icon-tv"} width={20} height={20} />
          <p>{el.TV} TV</p>
        </>
      );
      break;
    case "airConditioner":
      content = (
        <>
          <Icon iconid={"icon-air-conditioner"} width={20} height={20} />
          <p>{el.airConditioner} Air Conditioner</p>
        </>
      );
      break;
    case "bathroom":
      content = (
        <>
          <Icon iconid={"icon-shower"} width={20} height={20} />
          <p>{el.bathroom} Bathroom</p>
        </>
      );
      break;
    case "beds":
      content = (
        <>
          <Icon iconid={"icon-bed"} width={20} height={20} />
          <p>{el.beds} Beds</p>
        </>
      );
      break;
    case "freezer":
      content = (
        <>
          <Icon iconid={"icon-freezer"} width={20} height={20} />
          <p>{el.freezer} Freezer</p>
        </>
      );
      break;
    case "gas":
      content = (
        <>
          <Icon iconid={"icon-gas"} width={20} height={20} />
          <p>{el.gas}</p>
        </>
      );
      break;
    case "hob":
      content = (
        <>
          <Icon iconid={"icon-hob"} width={20} height={20} />
          <p>{el.hob} Hob</p>
        </>
      );
      break;
    case "kitchen":
      content = (
        <>
          <Icon iconid={"icon-kitchen"} width={20} height={20} />
          <p>{el.kitchen} Kitchen</p>
        </>
      );
      break;
    case "microwave":
      content = (
        <>
          <Icon iconid={"icon-microwave"} width={20} height={20} />
          <p>{el.microwave} Microwave</p>
        </>
      );
      break;
    case "radio":
      content = (
        <>
          <Icon iconid={"icon-radio"} width={20} height={20} />
          <p>{el.radio} Radio</p>
        </>
      );
      break;
    case "shower":
      content = (
        <>
          <Icon iconid={"icon-shower"} width={20} height={20} />
          <p>{el.shower} Shower</p>
        </>
      );
      break;
    case "toilet":
      content = (
        <>
          <Icon iconid={"icon-toilet-paper"} width={20} height={20} />
          <p>{el.toilet} Toilet</p>
        </>
      );
      break;
    case "water":
      content = (
        <>
          <Icon iconid={"icon-water"} width={20} height={20} />
          <p>{el.water}</p>
        </>
      );
      break;
    case "adults":
      content = (
        <>
          <Icon iconid={"icon-people"} width={20} height={20} />
          <p>{el.adults} Adults</p>
        </>
      );
      break;
    case "transmission":
      content = (
        <>
          <Icon iconid={"icon-transmission"} width={20} height={20} />
          <p>{el.transmission}</p>
        </>
      );
      break;
    case "engine":
      content = (
        <>
          <Icon iconid={"icon-petrol"} width={20} height={20} />
          <p>{el.engine}</p>
        </>
      );
      break;

    default:
      content = <>default</>;
  }
  return <Item>{content}</Item>;
};
